import { useEffect, useState } from 'react';
import { motion } from 'framer-motion';

export default function M() {

  const [text, setText] = useState('');
  const fullText = "I am a skilled software developer specializing in web development and Java programming. With expertise in MERN stack and WordPress, I have successfully delivered a variety of online projects. My passion lies in crafting efficient and user-friendly solutions that leverage cutting-edge technologies to solve complex challenges.";

  useEffect(() => {
    let index = 0;
    const interval = setInterval(() => {
      setText(fullText.slice(0, index));
      index++;
      if (index > fullText.length) {
        clearInterval(interval);
      }
    }, 2);
    return () => clearInterval(interval);
  }, []);

  return (
    <div
      className="relative w-full min-h-screen bg-white"
      style={{
        backgroundImage: "url('./pexels-alex-andrews-271121-861443.png')",
        backgroundSize: "cover",
        backgroundPosition: "top",
        backgroundRepeat: "repeat-y",
      }}
    >
      <div className="flex">
        <motion.div 
          className="flex-col w-1/3"
          initial={{ opacity: 0, x: -50 }}
          animate={{ opacity: 1, x: 0 }}
          transition={{ duration: 1 }}
        >
          <div className="text-black font-black mt-20 ml-20 text-8xl">
            software <br />engineer
          </div>
          <motion.div 
            className="mt-40 ml-20 text-justify"
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            transition={{ duration: 2, delay: 0.5 }}
          >
            <p className="mt-20 text-lg bg-gradient-to-t from-blue-700 to-black bg-clip-text text-transparent">
              {text}
            </p>
          </motion.div>
        </motion.div>

        <motion.div
          className="relative mt-15 flex w-full h-screen opacity-70"
          style={{
            backgroundImage: "url('./image1.png')",
            backgroundSize: "cover",
            opacity:"80%",
            backgroundPosition: "top",
            backgroundRepeat: "no-repeat",
          }}
          initial={{ opacity: 0, scale: 1 }}
          animate={{ opacity: 1, scale: 1 }}
          transition={{ duration: 1, delay: 0 }}
        >
          <a className="text-7xl font-black mt-[620px] ml-56">
            <a className="text-white">M </a> 
            <a className="text-blue-500">Jay</a>
          </a>
        </motion.div>

        <motion.div 
          className="bg-gray-200 text-8xl font-black w-1/5"
          initial={{ x: 50, opacity: 0 }}
          animate={{ x: 0, opacity: 1 }}
          transition={{ duration: 1 }}
        >
          <p className="-rotate-90 mt-96">
            <a className="text-white">mihisara</a> jaysinghe
          </p>
        </motion.div>
      </div>

      <motion.div 
        className="inline-flex absolute top-[750px] text-lg bg-gray-200 h-24 w-full text-4xl font-black justify-led pt-5"
        initial={{ y: 50, opacity: 0 }}
        animate={{ y: 0, opacity: 1 }}
        transition={{ duration: 1, delay: 1 }}
      >
        <nav className="pl-20 text-gray-600">ui./ux</nav>
        <nav className="pl-20">full stack</nav>
        <nav className="pl-20 text-white">ui./ux</nav>
        <nav className="pl-20">mobile</nav>
        <nav className="pl-20">ui./ux</nav>
      </motion.div>

      <div className='h-96'>
        kalfaskaskdaskdaaaskm
      </div>
    </div>
  );
        }
